import React, {PureComponent} from 'react'

export default class App extends PureComponent {
    state = {
        reverted: false
     }
    render() {
        return (
            <h1>Привет, мир!</h1>
        )
    }

    revert = () => {
        this.setState({
            reverted: !this.state.reverted
        })
    }
}
